export function ExpenseDate({ item }) {
  const month = (item) => item.date.toLocaleString('en-US', { month: 'long' });
  const day = (item) => item.date.toLocaleString('en-US', { day: '2-digit' });
  const year = (item) => item.date.getFullYear();
  return (
    <div>
      <div>{month(item)}</div>
      <div>{year(item)}</div>
      <div>{day(item)}</div>
    </div>
  );
}
